@จับควันดำจริงจังเถอะค่ะ เห็นรถควันดำวิ่งผ่าน สน ฉลุยเลย
@โรงงานปล่อยควันดำปี๋ เห็นตำรวจจราจรขี่มอเตอร์ไซด์ผ่านไปเฉยๆ
@เผาค่ะ ลอยฟุ้งทั่วฟ้า เป็น ชม ก็ไม่เห็นทำอะไร
เรื่องใกล้ตัวทำก่อนเถอะค่ะ เรื่องใช้เงินซื้อกรองฝุ่นหัวรถเมล์หยุดเถอะ ขอร้อง

#รัฐบาลเตรียมพร้อม
